var gravityPlaces=function(){var e;$.getJSON("../js/places.js",function(t){e=t;console.log(e)});this.comparedGravity=function(t,n){var r=e[t].gravity;var i=e[n].gravity;if(r>i)return 0;else if(r<i)return 1;else return 2};this.percentageGravity=function(t,n){result=this.comparedGravity(t,n);gravity1=e[t].gravity;gravity2=e[n].gravity;if(result==0)return gravity1*100/gravity2;else if(result==1)return gravity2*100/gravity1;else return 1};this.getName=function(t){return e[t].name};this.getDescription=function(t){return e[t].description};this.getGravity=function(t){return e[t].gravity}}